import axios from "axios"

class UserService {


     loginUser(json) {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response =  axios.post("http://localhost:8102/users/validate", json, axiosConfig);
        return response.data;
    }

    registerUser(json) {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response = axios.post("http://localhost:8102/users/save", json, axiosConfig);
        return response.data;
    }

}

export default new UserService();
